import React from 'react';
import {View, Text} from 'react-native';


const PeopleDetailsPage = ({ navigation }) => {
    const id = navigation.getParam('id')
    return(
            <View>
                <Text>Item {id}</Text>
            </View>
    ) 
}

export default PeopleDetailsPage;
